description:
Le Ministère en charge de l’environnement a lancé en 2007 la réalisation de l'inventaire national du patrimoine géologique, versant géodiversité du patrimoine naturel, à l’instar des ZNIEFF pour le versant biodiversité. Cette mission est déléguée en région aux DREAL. L’inventaire du patrimoine géologique de la région Auvergne-Rhône Alpes compte 490 sites validés (avril 2022) par le Muséum national d’histoire naturel et intégrés à l’inventaire national (INPG). Une dizaine d’autres sont à l’étude et seront soumis à l’examen du CSRPN puis de la Commission nationale. Une information des collectivités sera réalisée au préalable.
En savoir plus : http://www.auvergne-rhone-alpes.developpement-durable.gouv.fr/patrimoine-geologique-r3552.html
Il répertorie les sites d’intérêt géologique et se présente en 3 niveaux d'informations distincts :
- 1 donnée géographique décrivant les sites surfaciques ;
- 1 donnée géographique détaillant les sites ponctuels ;
- 1 donnée géographique ponctuel présentant les "point de vue" desquels on peut admirer les sites référencés ;
- 1 donnée géographique des sites confidentiels agrégés à la maille communale ;
- 1 donnée géographique des sites en projet / à l'étude ;
- 1 donnée géographique des sites confidentiels en projet / à l'étude agrégés à la maille communale

Ce jeu de données recense l’ensemble des panneaux dédiés à l’affichage de libre expression sur la commune de Soissons.
Il précise pour chaque panneau :
* le **nom ou identifiant** du panneau ;
* la **rue d’implantation** ;
* ses **coordonnées géographiques** (latitude, longitude) ;
* un champ de **géolocalisation** permettant la visualisation cartographique.
Ce jeu vise à faciliter la transparence sur les infrastructures d’expression citoyenne disponibles dans l’espace public.

Ce jeu de données recense les itinéraires cyclables présents sur le territoire de la Ville de Soissons en 2020.
Il a pour objectif de représenter spatialement les aménagements dédiés à la mobilité douce afin de favoriser leur réutilisation dans des outils de cartographie ou d’analyse urbaine.
Les attributs décrivent notamment :
* la nature de l’aménagement (bande cyclable, voie partagée, etc.) ;
* l’état de la voie ;
* la domanialité ;
* le nom de la voie concernée ;
* la date de création ;
* les coordonnées géographiques.

Ce jeu de données recense les associations actives sur la commune de Soissons.\
Il a pour objectif de mettre à disposition du public un annuaire regroupant les structures associatives locales, classées par domaine d’activité.
Chaque association est décrite à travers :
* un nom statutaire
* une **description synthétique** ;
* les **coordonnées de contact** (nom du référent, téléphone, e-mail) ;
* les **liens vers les réseaux sociaux** (Facebook, Instagram) ou site internet ;
* les **lieux de pratique** et **communes d’intervention**.

Périmètre des Etablissements public de coopération intercommunale (à fiscalité propre ou autres)
Les établissements publics de coopération intercommunale (EPCI) sont des regroupements de communes ayant pour objet l'élaboration de « projets communs de développement au sein de périmètres de solidarité ». Ils sont soumis à des règles communes, homogènes et comparables à celles de collectivités locales.
Les informations présentées ici concernent les EPCI à fiscalité propre :
    Communauté Urbaine (CU) ;
    Communauté d'Agglomération (CA) ;
    Communauté de Communes (CC) ;
    Syndicat d'Agglomération Nouvelle (SAN) ;
    Métropole (ME).
Il existe par ailleurs des EPCI sans fiscalité propre : les Syndicats Intercommunaux à Vocation Unique (SIVU), les Syndicats Intercommunaux à Vocation Multiple (SIVOM), les Syndicats Mixtes fermés (SM fermés) et les Syndicats Mixtes ouverts (SM ouverts). 
liste de communes des EPCI à fiscalité propre téléchargeable sur le site de l'INSEE
- Données obtenues depuis la base de données ASPIC du ministère de l'intérieur (cf. URL communiquée) pour tout ou partie des départements ;

Ce jeu de données contient les projections nationales d'émissions de gaz à effet de serre (GES) d'origine anthropique, telles qu'établies au titre de l'[article 18 du règlement européen (UE) 2018/1999 sur la gouvernance de l'union de l'énergie et de l'action pour le climat](https://eur-lex.europa.eu/legal-content/FR/TXT/PDF/?uri=CELEX:32018R1999#page=26), publiées en 2025 pour la période 2025-2055.
Il contient les tables suivantes :
* Tables 1a, 1b, 5a, 5b : résultats GES des scénarios AME ("avec mesures existantes" - WEM) et AMS ("avec mesures supplémentaires" - WAM) ;
  * Table 1a : projections de GES par gaz et par catégorie ;
  * Table 1b : projections rapportées d'émissions et d'absorptions de GES dans le secteur "Utilisation des terres, changement d'affectation des terres" (LULUCF), telles que rapportées dans l'inventaire national des GES ;
  * Table 5a : projections rapportées d'émissions et d'absorptions par le secteur "Utilisation des terres, changement d'affectation des terres" (LULUCF), par gaz, et selon les catégories définies dans le [règlement (UE) 2018/841](https://eur-lex.europa.eu/legal-content/FR/TXT/HTML/?uri=CELEX:32018R0841) ;
  * Table 5b : projections rapportées d'émissions et d'absorptions par le secteur "Utilisation des terres, changement d'affectation des terres" (LULUCF), conformément au règlement (UE) 2018/841 et le secteur de répartition de l'effort, conformément au [règlement (UE) 2018/842](https://eur-lex.europa.eu/legal-content/FR/TXT/HTML/?uri=CELEX:32018R0842) ;
* Table 2 : Résultats en intensité GES/PIB (Produit intérieur brut) des scénarios ;
* Table 3 : principales hypothèses des scénarios ;
* Table 4 : descriptif des modèles utilisés ;
* Table 6-7 : études de sensibilité autour des résultats des scénarios.
  * Table 6 : résultats de l'analyse de sensibilité.
  * Table 7 : variables clés de l'analyse de sensibilité.

Tableau d'assemblage des 5460 dalles de Modèle Numérique de Terrain (MNT) et Modèle Numériques de Surface (MNS) au format ASC acquis par la DREAL en 2013 afin de répondre aux besoins de la Directive Inondation sur les TRI de Annecy, Chambery, Grenoble, Albertville, Lyon, Saint-Etienne, Macon, Romans, Valence et Vienne.
Densité et précision des données
On impose les caractéristiques suivantes concernant la précision des échos Lidar mesurés :
Chaque m² contient deux impulsions par m² ;
précisions planimétriques : meilleures que 50 cm en X et en Y;
précision altimétrique : meilleure que 20 cm en Z;
Les dalles ont un pas de 1 m et font 1kmx1km. Leur poids est de 5 à 7 Mo;
Les levers ont été effectués par les prestataires IMAO et TOPOGEODIS selon les spécifications du RGE Alti Lidar de l'IGN (même cahier des charges).
Les données levées ont vocation à alimenter le RGE Alti de l'IGN.
Pour obtenir ces données de manière libre, faites une demande à la DREAL en fournissant la liste des dalles à obtenir. Si le nombre est inférieur à 200 dalles (1Go) l'envoi se fera de manière numérique, sinon il se fera par disque dur mis à disposition de la DREAL par le demandeur.
